import { createAsyncThunk, createSlice } from "@reduxjs/toolkit";
import endPoints from "../../API/endPoints";
import { apiInstance } from "../../API/axios";
import { GetServiceDetailsType } from "../../types/GetServiceDetailsType";


const initialState: GetServiceDetailsType = {
    name: ""
}

export const getServiceDetailsAction = createAsyncThunk(
    'getServiceDetailsActionType',
    async () => {
        const getServiceDetailsResponse = await apiInstance(endPoints.GET_SERVICE_DETAILS_API)
            .then((res) => {
                return res.data.data
            })
        console.log("getServiceDetailsResponse--->", getServiceDetailsResponse)
        return getServiceDetailsResponse;
    }
)
